import React from "react";
import { Item } from "./Item";

export const Items = ({ items, onAdd, onShowItem, fullitem }) => {
    return (
        <div className="items">
            {items.map(el => (
                <Item key={el.id} item={el} onAdd={onAdd} onShowItem={onShowItem} fullitem={fullitem} />
            ))}
        </div>
    )
}
